      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT ( NOT ( NOT ( NOT 28 NOT BETWEEN ( - CAST ( NULL AS INTEGER ) / - col2 ) AND + col1 / - 56 + + - 21 + - 25 ) ) );
  - name: tab1

outputs:
